import '../css/dashboard.css';
import BarChartIcon from '@mui/icons-material/BarChart';

function Title() {
  return (
    <div>
      <div className="TitlePaper" >
        <b>Dashboard</b>
        <BarChartIcon style={{textAlign:'end'}}/>
      </div>
    </div>
  );
}

export default Title;
